import React, { useState } from 'react';
import { Search, Bell, Clock, MapPin, ArrowLeft, X } from 'lucide-react';
import Notifications from './Notifications';

const Dashboard = ({ user, events, theme, regCount, setSearchTerm, searchTerm }) => {
  const isDark = theme === 'dark';
  const [isSearchOpen, setIsSearchOpen] = useState(false);
  const [isNotiOpen, setIsNotiOpen] = useState(false);

  // Switch to full-page Notifications view if open
  if (isNotiOpen) {
    return (
      <div style={{ 
        maxWidth: '430px', 
        margin: '0 auto', 
        padding: '16px', 
        minHeight: '100vh',
        backgroundColor: isDark ? '#0f172a' : '#fff' 
      }}>
        <Notifications theme={theme} setIsOpen={setIsNotiOpen} />
      </div>
    );
  }

  const styles = {
    container: { 
      maxWidth: '430px', 
      margin: '0 auto', 
      padding: '16px', 
      paddingBottom: '100px', 
      minHeight: '100vh',
      backgroundColor: isDark ? '#0f172a' : '#fff',
    },
    header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' },
    searchContainer: { 
      display: 'flex', 
      alignItems: 'center', 
      gap: '12px', 
      backgroundColor: isDark ? '#1e293b' : '#f1f5f9', 
      padding: '12px 16px', 
      borderRadius: '16px',
      marginBottom: '24px'
    },
    greeting: { fontSize: '32px', fontWeight: 'bold', margin: '10px 0 5px 0', color: isDark ? '#fff' : '#1e293b' },
    subText: { color: '#64748b', fontSize: '14px', marginBottom: '24px' },
    
    // Stats Grid updated to 1x2 layout
    statsRow: { 
      display: 'grid', 
      gridTemplateColumns: 'repeat(2, 1fr)', 
      gap: '12px', 
      marginBottom: '24px' 
    },
    statCard: { 
      backgroundColor: isDark ? '#1e293b' : '#f8fafc', 
      padding: '16px', 
      borderRadius: '16px', 
      color: isDark ? '#fff' : '#1e293b',
      border: isDark ? '1px solid #334155' : '1px solid #e2e8f0',
      display: 'flex',
      flexDirection: 'column',
      gap: '4px'
    },
    
    eventCard: { 
      backgroundColor: isDark ? '#1e293b' : '#fff', 
      borderRadius: '24px', 
      padding: '16px', 
      marginBottom: '20px',
      border: isDark ? '1px solid #334155' : '1px solid #f1f5f9',
      boxShadow: '0 4px 6px rgba(0,0,0,0.02)'
    },
    regBtn: { 
      width: '100%', 
      backgroundColor: '#2563eb', 
      color: '#fff', 
      border: 'none', 
      padding: '14px', 
      borderRadius: '14px', 
      fontWeight: 'bold', 
      marginTop: '16px',
      fontSize: '16px',
      cursor: 'pointer'
    }
  };

  return (
    <div style={styles.container}>
      {/* 1. Header with Search Toggle */}
      {!isSearchOpen ? (
        <header style={styles.header}>
          <div style={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
            <div style={{ width: '40px', height: '40px', borderRadius: '50%', backgroundColor: '#2563eb', color: '#fff', display: 'flex', justifyContent: 'center', alignItems: 'center', fontWeight: 'bold' }}>ES</div>
            <span style={{ fontWeight: 'bold', fontSize: '18px', color: isDark ? '#fff' : '#1e293b' }}>EventSphere</span>
          </div>
          <div style={{ display: 'flex', gap: '15px', color: isDark ? '#94a3b8' : '#1e293b' }}>
            <Search size={24} onClick={() => setIsSearchOpen(true)} style={{ cursor: 'pointer' }} />
            <Bell size={24} onClick={() => setIsNotiOpen(true)} style={{ cursor: 'pointer' }} />
          </div>
        </header>
      ) : (
        <div style={styles.searchContainer}>
          <ArrowLeft 
            size={22} 
            onClick={() => { setIsSearchOpen(false); setSearchTerm(""); }} 
            style={{ cursor: 'pointer', color: isDark ? '#fff' : '#1e293b' }} 
          />
          <input 
            autoFocus
            placeholder="Search events..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            style={{ 
              flex: 1, border: 'none', background: 'transparent', outline: 'none', 
              color: isDark ? '#fff' : '#000', fontSize: '16px' 
            }}
          />
          {searchTerm && <X size={20} onClick={() => setSearchTerm("")} style={{ cursor: 'pointer', color: '#94a3b8' }} />}
        </div>
      )}

      {/* 2. Welcome Section */}
      <h1 style={styles.greeting}>Hi Priya ðŸ‘‹</h1>
      <p style={styles.subText}>Explore college events</p>

      {/* 3. Updated Stats Grid (Only Upcoming and Registered) */}
      <div style={styles.statsRow}>
        <div style={styles.statCard}>
          <div style={{ fontSize: '14px', color: '#64748b' }}>Upcoming</div>
          <div style={{ fontSize: '24px', fontWeight: 'bold' }}>{events.length}</div>
        </div>
        <div style={styles.statCard}>
          <div style={{ fontSize: '14px', color: '#64748b' }}>Registered</div>
          <div style={{ fontSize: '24px', fontWeight: 'bold' }}>{regCount}</div>
        </div>
      </div>

      {/* 4. Upcoming Events Section */}
      <h3 style={{ fontSize: '18px', marginBottom: '16px', color: isDark ? '#fff' : '#1e293b' }}>Upcoming Events</h3>
      
      {events.map(event => (
        <div key={event.id} style={styles.eventCard}>
          <img src={event.image} alt={event.title} style={{ width: '100%', height: '180px', objectFit: 'cover', borderRadius: '16px', marginBottom: '12px' }} />
          <h4 style={{ margin: '0 0 8px 0', fontSize: '18px', color: isDark ? '#fff' : '#1e293b' }}>{event.title}</h4>
          <div style={{ display: 'flex', alignItems: 'center', gap: '8px', fontSize: '14px', color: '#64748b' }}>
            <Clock size={16} /> {event.date}
          </div>
          <button style={styles.regBtn}>Register</button>
        </div>
      ))}
    </div>
  );
};

export default Dashboard;
